    <div className="container">
      <div className="row no-gutters h-30">
        <div className="h-30 p-2 col-md-4">
          <div className="pnl convex"></div>
        </div>
        <div className="h-30 p-2 col-md-4">
          <div className="pnl convex"></div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
